import Modal from "../components/Modal";

export default function ModalPage() {
    const [showModal, setShowModal] = useState(false);
    const handleClick = () => {
        setShowModal(true);
    };

    return (
        <div>
            <button onClick={handleClick}>Modal</button>
            <Modal />
        </div>
    )
}
